        function validaFechaNacimiento(){
             var msj = validaciones.fechanac(vm.objAlumno.fechaNacimiento);
             
                if(msj){
                  
                    pre = moment(vm.objAlumno.fechaNacimiento, "DD/MM/YYYY", true);
                   
                        if(pre.isValid()){
                            var actual = moment(new Date());
                            var fNacimiento = moment([pre.get('year'), pre.get('month'), pre.get('date')]);
                            vm.objAlumno.edad =   actual.diff(fNacimiento, 'years');
                             if(parseInt(vm.objAlumno.edad)<5 || parseInt(vm.objAlumno.edad)>15){
                                vm.objAlumno.edad=undefined;
                                //console.log("edad fuera de rango");
                                swal("Error",'solo aceptamos niños de 5 a 15 años','error');
                                }else{
                                vm.objAlumno.edad = parseInt(vm.objAlumno.edad);
                                }
                        }else{
                             swal("Ups!",'Fecha invalida!', 'error');
                             vm.objAlumno.fechaNacimiento = "";
                             vm.objAlumno.edad = ""; 
                        }   
                      
                }else{
                     swal("Ups!",'Este campo solo permite este formato dd/mm/aaaa!', 'error'); 
                    vm.objAlumno.fechaNacimiento = "";
                     vm.objAlumno.edad= " ";

                }
        }


